Extension methods to System namespace classes. DayMonth, MonthYear, generic Range structs; 
Localized Holiday Calculators with Easter calculation; 
Type Extensions; 
Expression Extensons; 
Lambda parameter replacement; 
String Extensions;
Wordifier for numbers in pt-br and much more to come! 
Fork me on github!

